import React, { useState, useRef } from "react";
import {
  SafeAreaView,
  StyleSheet,
  ActivityIndicator,
  View,
  TouchableOpacity,
  Text,
} from "react-native";
import WebView from "react-native-webview";

export default Dashboard = React.forwardRef(({ navigation, route }) => {
  const webviewRef = useRef(null);
  const redirect_url = "http://localhost:5000/redirect/";

  const onNavigation = (navState) => {
    if (navState.url.includes(redirect_url)) {
      navigation.navigate("Complete");
    }
  };

  console.log(route.params.param);
  
const styles = StyleSheet.create({
  flexContainer: {
    flex: 1,
  },
  margin: {
    marginTop: 50,
  },
});


  return (
    <>
      <SafeAreaView style={styles.flexContainer}>
        <WebView
          source={{
            uri: route.params.param,
          }}
          startInLoadingState={true}
          renderLoading={() => (
            <ActivityIndicator
              color="black"
              size="large"
              style={styles.flexContainer}
            />
          )}
          ref={webviewRef}
          onNavigationStateChange={onNavigation}
          style={styles.margin}
        />
      </SafeAreaView>
    </>
  );
});
